import styled from "styled-components";

const StyledProductCard = styled.a`
  display: block;
  border-radius: 1.66667rem;
  background: #F9F8F8;
`

function ProductCard({}) {
  return (
    <StyledProductCard>

    </StyledProductCard>
  );
}

export default ProductCard;
